import React from 'react'

const TitleSearch = (props) => {

    const handleChange = props.handleChange
    const search = props.search

    const submit = () => {
        alert("searched")
    }

    return (
        <>
        <input value={search} onChange={handleChange} name="search" type="text"></input>
        <button onClick={submit}><label forhtml="search">Search</label></button>
        </>
    )
}

export default TitleSearch
